import React from 'react'
import { Segment, Sidebar, Divider,Menu, Header } from 'semantic-ui-react'

class SidePanelLeft extends React.Component{
    render(){

        return(
          <Menu

            inverted
            fixed='left'
            vertical
            style={{maxWidth: '250px',background: '#e7e7e7', top: '80px'}}
          >
            <Menu.Item>
              <Header as='h2'>
                Channels
              </Header>
            </Menu.Item>


          </Menu>
        )

    }
}

export default SidePanelLeft;
